import React, { useState, useEffect } from 'react';
import FbiPersonCard from './FbiPersonCard';

const FbiPage = () => {
  const [fbiPersons, setFbiPersons] = useState([]);

  useEffect(() => {
    fetch('https://vigilant-api-a2xyukeyka-uc.a.run.app/fbi/getallwanted?page=1')
      .then((response) => response.json())
      .then((data) => setFbiPersons(data))
      .catch((error) => console.error('Erro ao buscar dados do FBI:', error));
  }, []);

  return (
    <div className="container mt-3">
      <div className="row">
        {fbiPersons.map((person) => (
          <div key={person.id} className="col-md-4">
            <FbiPersonCard person={person} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default FbiPage;
